@use 'settings/generic/colors';
@use 'settings/vendors/bootstrap';

.a-rspd-input {

    &__input {
        width: 100%;
        display: block;
        padding: 1rem 1.5rem;
        font-family: inherit;
        font-size: 1rem;
        color: inherit;
        background-color: rgba(bootstrap.$white, .5);
        border-radius: 0.125rem;
        border: 0.0625rem solid colors.$outline;
        transition: all .2s;

        &:focus {
            border-color: colors.$primary-400;
        }

        &:focus:invalid {
            border-color: colors.$bad;
        }
    }

    &__label {
        display: block;
        margin-top: .4rem;
        margin-left: 1.5rem;
        transition: all .3s;
        font-size: 0.675rem;
        font-weight: bootstrap.$light;
        color: colors.$outline;
    }

    &__input:placeholder-shown + &__label {
        visibility: hidden;
        opacity: 0;
        transform: translateY(-2rem);
    }
}

